<icon BUILTIN="element"/>
<node TEXT="#!/bin/bash" ID="ID_226146924" CREATED="1665525835355" MODIFIED="1708002602285">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="output=$(./verificaMapa.sh)" ID="ID_1144619103" CREATED="1727467846293" MODIFIED="1727467888512">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="# Conte o número de linhas na saída" ID="ID_245989230" CREATED="1727467846293" MODIFIED="1727467888512">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="line_count=$(echo &quot;$output&quot; | wc -l)" ID="ID_128999534" CREATED="1727467846295" MODIFIED="1727467888512">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="# Verifique se o número de linhas é maior que 3" ID="ID_1389784836" CREATED="1727467846295" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="if [ &quot;$line_count&quot; -gt 1 ]; then" ID="ID_1219749868" CREATED="1727467846295" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="    echo &quot;====================================================================&quot; " ID="ID_613195858" CREATED="1727467859345" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="    echo &quot;Conteúdo do mapa:&quot; " ID="ID_950297730" CREATED="1727467862512" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="    echo &quot;$output&quot; " ID="ID_756599177" CREATED="1727467865712" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="    echo &quot;====================================================================&quot; " ID="ID_1848965128" CREATED="1727467868401" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="    echo &quot;Pressione qualquer tecla para sair...&quot; " ID="ID_585275206" CREATED="1727467871405" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="    read -n 1 -s   " ID="ID_1106670073" CREATED="1727467874125" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="    exit 1 " ID="ID_1386846674" CREATED="1727467877621" MODIFIED="1727467888511">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="else" ID="ID_374451568" CREATED="1727467846299" MODIFIED="1727467888510">
<icon BUILTIN="tag_green"/>
</node>
<node TEXT="    echo &quot;Mapa correto, continuando a geração.&quot; " ID="ID_1923379613" CREATED="1727467881575" MODIFIED="1727467888510">
<icon BUILTIN="tag_green"/>
</node>
